import Layout from '../components/layout';
import Plot from 'react-plotly.js';
import React, { Component } from 'react';
class Chart extends Component {
    constructor(props) {
        super(props);

        this.state = {
            data: [
                {
                    "age": 45,
                    "name": "Frank",
                    "sex": "m",
                    "wpm": 87
                },
                {
                    "age": 120,
                    "name": "Jerry",
                    "sex": "m",
                    "wpm": 20
                },
                {
                    "age": 22,
                    "name": "Jill",
                    "sex": "f",
                    "wpm": 72
                },
                {
                    "age": 75,
                    "name": "Regis",
                    "sex": "m",
                    "wpm": 44
                },
                {
                    "age": 27,
                    "name": "Tracy",
                    "sex": "f",
                    "wpm": 0
                }
            ],
        };
    }

    render() {
        return (
            <div>
                <Layout>
                    <Plot
                        data={[
                            {
                                x: ["Frank", "Jerry", "Jill", "Regis", "Tracy"],
                                y: [1, 2, 3, 4, 5],
                                type: 'histogram',
                                mode: 'lines+markers',
                                marker: { color: 'green' },
                            },
                            // { type: 'bar', x: [1, 2, 3], y: [2, 5, 3] },
                        ]}
                        layout={{ width: 450, height: 450, title: 'Name vs WPM' }}
                    />
                </Layout>
            </div>
        );
    }
}



export default Chart;
